    <CustomButtonContainer className={`${inverted ? 'inverted' : '' } ${isGoogleSignIn ? 'google-sign-in' : '' } custom-button`} {...othrProbs}> 
        {children}
    </CustomButtonContainer>
);

export default CustomButton;
